import { useState, useEffect} from "react";
import axios from "axios";

export default function Peternakan() {
const Peternakan = () => {
    const [peternakans, setPeternakan] = useState([])
  
    const fetchDataPeternakan = () => {
      fetch("http://localhost:8000/api/peternakan")
        .then(response => {
          return response.json()
        })
        .then(data => {
          setPeternakan(data)
        })
    }

    useEffect(() => {
        fetchPeternakan()
      }, [])

    return (
        <div>
          Test
        </div>
      );
    }
}
